import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  const [currentDateTime, setCurrentDateTime] = useState(new Date());

  useEffect(() => {
    const intervalId = setInterval(() => {
      setCurrentDateTime(new Date());
    }, 1000); // Update every second

    return () => clearInterval(intervalId); // Cleanup on unmount
  }, []);

  const formattedDate = currentDateTime.toLocaleDateString('en-US', {
    weekday: 'long',
    day: 'numeric',
    month: 'long',
    year: 'numeric'
  });

  // const formattedTime = currentDateTime.toLocaleTimeString('en-US', {
  //   hour: 'numeric',
  //   minute: 'numeric',
  //   second: 'numeric'
  // });

  const dayWithOrdinal = (day) => {
    const suffixes = ['th', 'st', 'nd', 'rd'];
    const relevantDigits = (day < 30) ? day % 20 : day % 30;
    const suffix = (relevantDigits <= 3) ? suffixes[relevantDigits] : suffixes[0];
    return `${day}${suffix}`;
  };

  const formattedDateTime = `${formattedDate}, ${dayWithOrdinal(
    currentDateTime.getDate()
  )} ${currentDateTime.toLocaleDateString('en-US', {
    month: 'long'
  })} ${currentDateTime.getFullYear()}, ${formattedTime}`;

  return (
    <nav className="navbar navbar-expand-lg bg-body-tertiary">
      <div className="container-fluid">
        <Link className="navbar-brand no-hover" to="/">NexGenHome</Link>
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav me-auto mb-2 mb-lg-0">
            <li className="nav-item">
              <Link className="nav-link active" aria-current="page" to="/">Home</Link>
            </li>
            <li className="nav-item dropdown">
              <a className="nav-link dropdown-toggle" href="#" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                Select a room
              </a>
              <ul className="dropdown-menu">
                <li><Link className="dropdown-item" to="/living-room">Living Room</Link></li>
                <li><Link className="dropdown-item" to="/bedroom">Bedroom</Link></li>
                <li><Link className="dropdown-item" to="/kitchen">Kitchen</Link></li>
                <li><Link className="dropdown-item" to="/bathroom">Bathroom</Link></li>
                <li><Link className="dropdown-item" to="/office">Office</Link></li>
                <li><Link className="dropdown-item" to="/dining">Dining Room</Link></li>
              </ul>
            </li>
          </ul>
          <div className="navbar-text">
            {formattedDateTime}
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
